    "### Changelog Summary (since 2024-06-20)\n\n- **Dynamic Import Attributes**: Support for dynamic import attributes in `--module preserve`.\n- **Discrimination Logic**: Enhanced discrimination logic to allow partial matches.\n- **Performance Data**: Improved consistency and correctness of performance data reporting.\n- **JSDoc Import Tag**: Fixed handling of `@import` JSDoc tag with resolution-mode import attribute.\n- **Accessor Crash**: Resolved crash issue with 'accessor' for invalid modifier locations.\n- **Module Resolution**: Avoided module resolution errors when using `getSymbolAtLocation`.\n- **Baseline Fixes**: Addressed missed baselines in previous merges.\n- **Async Request Reporting**: Included `updateGraph` time in async requests.\n- **Object.values/entries**: Updated `es2017.object.d.ts` to reflect that `Object.values/entries` only look at own properties.\n- **Array Methods**: Added non-mutating Array methods to `es2023` in the lib/target suggestion list.\n- **Library Condition**: Corrected library condition handling.\n- **TypeScript Update**: Updated to TypeScript 5.5.2.\n\n### Individual Pull Requests\n\n1. **Allow dynamic import attributes in `--module preserve`** ([#59005](https://github.com/microsoft/TypeScript/commit/fa4f2e5148ac8843fd8e6632483f85fb1279ffca))\n   - Author: Andrew Branch\n   - Date: 2024-06-25\n   - Summary: Added support for dynamic import attributes when using `--module preserve`.\n\n2. **Allow partial matches in discrimination logic** ([#58974](https://github.com/microsoft/TypeScript/commit/6c01f6c584b01caf58f2e860fe954591e8591166))\n   - Author: Anders Hejlsberg\n   - Date: 2024-06-25\n   - Summary: Enhanced discrimination logic to allow partial matches.\n\n3. **Fix the consistency and correctness of performanceData reported per request** ([#58968](https://github.com/microsoft/TypeScript/commit/d403e0850f33521c684bbecd4a24522a4dc66b33))\n   - Author: Sheetal Nandi\n   - Date: 2024-06-25\n   - Summary: Improved the consistency and correctness of performance data reported per request.\n\n4. **Fix(58955): @import JSDoc tag doesn't seem to account for resolution-mode import attribute in TS v5.5.2** ([#58966](https://github.com/microsoft/TypeScript/commit/c219989232a9db9fb6a5057dd34e21acc628a3b1))\n   - Author: Oleksandr T\n   - Date: 2024-06-24\n   - Summary: Fixed handling of `@import` JSDoc tag with resolution-mode import attribute.\n\n5. **Fix 'accessor' crash for invalid modifier locations** ([#58963](https://github.com/microsoft/TypeScript/commit/c76c418ffe4d71a7c5240f90ec5765df144c0e36))\n   - Author: Ron Buckton\n   - Date: 2024-06-24\n   - Summary: Resolved crash issue with 'accessor' for invalid modifier locations.\n\n6. **Consistently avoid module resolution errors when using `getSymbolAtLocation`** ([#58668](https://github.com/microsoft/TypeScript/commit/3743fbc748eeb72e2f1fcea2b1fde185cc4d063e))\n   - Author: Mateusz Burzyński\n   - Date: 2024-06-24\n   - Summary: Avoided module resolution errors when using `getSymbolAtLocation`.\n\n7. **Fix missed baselines with merge of #58845** ([#58964](https://github.com/microsoft/TypeScript/commit/5d70bf894efe9014d24d4ba439807311e5b33fb8))\n   - Author: Sheetal Nandi\n   - Date: 2024-06-21\n   - Summary: Addressed missed baselines in previous merges.\n\n8. **Report updateGraph time in async requests (that is getErr) as well as part of request completed event** ([#58845](https://github.com/microsoft/TypeScript/commit/600dde88346527e6392fa741b66626c1c1c156fc))\n   - Author: Sheetal Nandi\n   - Date: 2024-06-21\n   - Summary: Included `updateGraph` time in async requests.\n\n9. **Update es2017.object.d.ts to indicate that Object.values/entries looks only at own properties** ([#58953](https://github.com/microsoft/TypeScript/commit/dd5d690a0dc41d4fe69985c89940acc96b4c91a7))\n   - Author: Joe Pea\n   - Date: 2024-06-21\n   - Summary: Updated `es2017.object.d.ts` to reflect that `Object.values/entries` only look at own properties.\n\n10. **Add non-mutating Array methods to es2023 in the lib/target suggestion list** ([#58951](https://github.com/microsoft/TypeScript/commit/327bd0990f2ce3a7062f4c9bf0b8027cc44b2f4f))\n    - Author: Daniel Rosenwasser\n    - Date: 2024-06-20\n    - Summary: Added non-mutating Array methods to `es2023` in the lib/target suggestion list.\n\n11. **Fix incorrect lib condition again!** ([#58945](https://github.com/microsoft/TypeScript/commit/beb375a9cac75ba29abb707e6736e2d645ddb2f0))\n    - Author: Sheetal Nandi\n    - Date: 2024-06-20\n    - Summary: Corrected library condition handling.\n\n12. **Update to TS 5.5.2** ([#58947](https://github.com/microsoft/TypeScript/commit/ef079c9dd3c9f82f38075085ac9821f08f423e52))\n    - Author: Jake Bailey\n    - Date: 2024-06-20\n    - Summary: Updated to TypeScript 5.5.2.",
